Компактные и изящные ланч-боксы Foodbag от компании ComplEAT - это: 
- экологичный материал - пищевой силикон, который не является токсичным, плюс легко моется;
- симпатичный дизайн, позволяющий при необходимости свернуть Foodbag в рулон диаметром всего 4 см;
- неплохая альтернатива унылым контейнерам (не в случае с супом, разумеется :))

Whiskey Ice Stone (набор из 9 камней) - идеальный подарок на 23 февраля ценителям виски.

Преимуществ множество, среди них следующие:
- камни не разбавляют напиток (в отличие ото льда; к тому же, если употреблять виски слишком теплым или слишком холодным, его вкус "закрывается");
- сделанные из стеатита, камни не будут царапать стаканы или впитывать вкус и запах;
- также их можно разогреть в микроволновке и класть в глинтвейн или чай :)
